import React from 'react'

const Card = ({ resData }) => {


  return (
    <div className=' w-[400px] h-[296px] flex justify-between m-5
    shadow-[1px_1px_2px_2px_#C0C0C0]'>
<div>
      <h1 className='font-[700] text-[30px]  mx-4 '>{resData.show.name}</h1>

      
      <h1 className='font-[400] text-[18px]  mx-4'>{resData.show.genres.join(", ")}</h1>
      </div>

      <div> {resData.show.image === null ?
        <div>No image </div> : <img alt='nothing'
          src={resData.show.image.medium}

        />}
      </div>




    </div>
  )
}

export default Card
